import React from "react";
import LoginForm from "./components/LoginForm";
import "./App.css"
import { BrowserRouter as Router, Routes, Switch, Link, Redicect } from "react-router-dom";


function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" component={LoginForm} />
        </Routes>
      </Router>
    </div>
  );
}


export default App;
